tokenData = tokenData.hash;

let w, h, sd, u, r, rw, rh, ho, vo, R;

function setup() {
	w = window.innerWidth;
	h = window.innerHeight;
	sd = Math.min(w, h);
	u = sd/10;
	createCanvas(sd, sd);
	colorMode(HSB, 100);
	background(100);
	noFill();
	strokeWeight(u/4);
	rectMode(CENTER);
	r = 4;
	R = new Random();
}

function draw() {
	for (let i = 1; i < r + 1; i++) {
		stroke(80);
		if (i == r) {
			stroke(0);
		}	
		rw = R.random_int(4, 8);
		rh = R.random_int(12 - rw, 8);
		while (rw == 8 && rh == 8) {
			rw = R.random_int(4, 8);
			rh = R.random_int(12 - rw, 8);
		}
		if (i == 1) {
			rw = rh = 8;
		}
		ho = R.random_int(-8 + rw, 8 - rw);
		vo = R.random_int(-8 + rh, 8 - rh);
		rect((sd/2) + ho/2 * u, (sd/2) + vo/2 * u, rw * u, rh * u);
	}
	noLoop();
}

class Random {
  constructor() {
    this.useA = false;
    let sfc32 = function (uint128Hex) {
      let a = parseInt(uint128Hex.substr(0, 8), 16);
      let b = parseInt(uint128Hex.substr(8, 8), 16);
      let c = parseInt(uint128Hex.substr(16, 8), 16);
      let d = parseInt(uint128Hex.substr(24, 8), 16);
      return function () {
        a |= 0; b |= 0; c |= 0; d |= 0;
        let t = (((a + b) | 0) + d) | 0;
        d = (d + 1) | 0;
        a = b ^ (b >>> 9);
        b = (c + (c << 3)) | 0;
        c = (c << 21) | (c >>> 11);
        c = (c + t) | 0;
        return (t >>> 0) / 4294967296;
      };
    };
    this.prngA = new sfc32(tokenData.substr(2, 32));
    this.prngB = new sfc32(tokenData.substr(34, 32));
    for (let i = 0; i < 1e6; i += 2) {
      this.prngA();
      this.prngB();
    }
  }
  random_dec() {
    this.useA = !this.useA;
    return this.useA ? this.prngA() : this.prngB();
  }
  random_num(a, b) {
    return a + (b - a) * this.random_dec();
  }
  random_int(a, b) {
    return Math.floor(this.random_num(a, b + 1));
  }
  random_bool(p) {
    return this.random_dec() < p;
  }
  random_choice(list) {
    return list[this.random_int(0, list.length - 1)];
  }
}
